import os
import csv
import json
from datetime import datetime

class Broker:
    def __init__(self):
        self.validation_rules = {
            'file_format': 'csv',
            'required_columns': ['column1', 'column2', 'column3']
        }

    def upload_file(self, file_path):
        if not os.path.isfile(file_path):
            raise FileNotFoundError("File not found")
        file_extension = os.path.splitext(file_path)[1]
        if file_extension != f'.{self.validation_rules["file_format"]}':
            raise ValueError("Invalid file format")
        return file_path

    def validate_file(self, file_path):
        with open(file_path, 'r') as file:
            reader = csv.reader(file)
            headers = next(reader)
            for column in self.validation_rules['required_columns']:
                if column not in headers:
                    raise ValueError("Missing required column")
        return True

class FABS:
    def __init__(self):
        self.submitted_files = []

    def submit_file(self, file_path, broker):
        if broker.validate_file(file_path):
            self.submitted_files.append(file_path)
            return "File submitted successfully"
        else:
            return "File validation failed"

